import { Component, Vue, Prop } from 'vue-property-decorator';

@Component({})
export default class UserMenu extends Vue {
    @Prop({default: true})
    private visible?: boolean;

    constructor() {
        super();
    }

    get isVisible() {
        return this.visible;
    }
}
